import React from 'react';
import { Card, CardImg, CardText, CardBody,CardTitle, CardSubtitle, Col,Button } from 'reactstrap';
import et_tavuk_pilav from '../assets/et_tavuk_pilav.jpeg';
import { Link } from 'react-router-dom'

const Bruiloften = (props) => {
  return (
    <Col sm="10">
        <Card>
            <CardImg top style={{width:100+'%'}} src="https://firebasestorage.googleapis.com/v0/b/newproject-6d1f4.appspot.com/o/Screen Shot 2019-01-03 at 22.32.43.png?alt=media&token=c5d79fd2-540d-4abc-a0bc-55df29577ca0" alt="Et-Tavuk-Karisik" />
            <CardBody>
            <CardTitle>BRUILOFTEN</CardTitle>
            <CardSubtitle>Bruiloften Menu</CardSubtitle>
            <CardText>Please click to see more details and the menus.</CardText>
            <Button color="primary"><Link style={{color:'white'}} to="/bruiloften">Click to go Bruiloften Menu</Link></Button>
            </CardBody>
        </Card>
    </Col>
  );
};

export default Bruiloften;
